import React from 'react';
import Pictures from './Pictures';



function Pic() {
    return (
        <div>
            <Pictures p={{
                img: 'https://picsum.photos/60',
                name: 'omarz',
                work: 'webdesigner',
                phone: '+49 123456',
                email: 'omarz@gmail.com'
            }} />

        </div>
    )
}

export default Pic;
